import './index_body.css';

import React, { useEffect } from 'react';
import Particles from 'react-particles-js';

const Index_body = () =>{
	return(
		<React.Fragment>
			<div class="index_body">
				<Particles
    				params={{
    					particles: {
    						number: {
    							value: 90,
    							density:{
                  					enable: true,
                 		 			value_area: 800
               					}	
	        				},
    						line_linked: {
            					shadow: {
            						enable: true,
            						color: "white",
            						blur: 5,
            					}
            				},
            				move:{
				                enable:true,
				                speed:2,
				                direction: "none",
				            }
            			},
            			interactivity: {
            				detect_on:"canvas",
            				events:{
	            				onhover: {
	            					enable: true,
	            					modes: "grab",
	            				},
	            				onclick:{
									enable: true,
									mode: "push",
								},

							},
							modes:{
								grab:{
									distance:200,
									line_linked:{
										opacity:1
									}
								},
								push:{
									particles_nb:4
								},
							}
            			}
					}} />

					<div class="text">

                    	<img src="/images/RaunakAnand.png" class="Raunak-Anand"/>
                    	<h1>Raunak Anand</h1>
                    	<h2>Computer Science and Statistics at UC Davis</h2>
                    	<h2>Software Engineer, Back End Intern at MasterClass</h2>

                    	<div className="social-logos">
                    		<a href="https://www.linkedin.com/in/raunak-anand/"><img src="/images/linkedin.png" class="logos"/></a>
                    		<a><img src="/images/github.png" class="logos"/></a>
                    		<a><img src="/images/spotify.png" class="logos"/></a>
                    		<a><img src="/images/mail.png" class="logos"/></a>
                    		<a><img src="/images/twitter.png" class="logos"/></a>
                    	</div>

                	</div>


			</div>
		</React.Fragment>
	);
}

export default Index_body;
